import React from 'react';
import './App.scss';

import Card from "./components/card/SymbolCard"

function App() {
  mockedapi = {
    "Meta Data": {
        "1. Information": "Daily Prices (open, high, low, close) and Volumes",
        "2. Symbol": "IBM",
        "3. Last Refreshed": "2020-05-22",
        "4. Output Size": "Compact",
        "5. Time Zone": "US/Eastern"
    },
    "Time Series (Daily)": {
        "2020-05-22": {
            "1. open": "119.3700",
            "2. high": "119.4650",
            "3. low": "117.5900",
            "4. close": "118.3900",
            "5. volume": "4179906"
        },
      }
    }
  return (
    <div className="App">
      <div className="card-container">
        <Card trending="up"></Card>
        <Card trending="up"></Card>
        <Card trending="down"></Card>
        <Card trending="down"></Card>
        <Card trending="up"></Card>
        <Card trending="up"></Card>
      </div>
    </div>
  );
}

export default App;
